import './App.css'
import { useState } from 'react';
import Students from './Students';


function App() {

  const [count,setCount]=useState(0)

  const addCount=()=>{

    setCount(count+1)
  }

  let std=[
    {name:'rahul',age:21},
    {name:'sumesh',age:22},
    {name:'safi', age:23}
  ]
  return (
    <div className='App'>
      <button onClick={addCount}>Add</button>
      {
        std.map((obj)=>{
          return(
            <Students name={obj.name}/>
          )

        })
      }

    </div>
  )
}

export default App;
